import imagezeta from '../../images/zetamonk_front.svg';
import pink from '../../images/pcloud.svg';
import {Landingsection,Imagewrapper,Image,Image2} from './LandingPage.element'
function LandingPage() {
    return (
      <Landingsection>
        
        <Image src={imagezeta}>

        </Image>
        
        <Image2 src={pink}>

        </Image2>
        <Landinheader>

        </Landinheader>

       
      </Landingsection>
    )
}

export default LandingPage
